import { createSlice } from "@reduxjs/toolkit";
import { getTagsAction } from "../Action/Action";
const initialState = {
  Tags: {
    data: [],
    isLoading: false,
    isSucess: false,
    errorMessage: "",
  },
  ReportData: {
    data: {},
    isLoading: false,
    isSucess: false,
    errorMessage: "",
  },

};

export const ScrapReducer = createSlice({
  name: "scrapData",
  initialState,
  reducers: {

  },
  extraReducers: {

    [getTagsAction.rejected]: (state, { payload }) => {
      state.Tags.isLoading = false;
      state.Tags.isSucess = false;
      state.Tags.ProductListData = payload
    },
    [getTagsAction.fulfilled]: (state, { payload }) => {
      state.Tags.isLoading = false;
      state.Tags.isSucess = true;
      state.Tags.data =  payload;
    },
  },
});

// Action creators are generated for each case reducer function
export const {

} = ScrapReducer.actions;

